Synopsis:
You both know its wrong, but something keeps pulling you back together. Midnight Mistress features four tales of men fucking their secret mistresses any chance they can sneak away. Starring the gorgeous Natalia Starr, Keira Nicole, Mia Leilani, and Kagney Lynn Karter, youd want to make these nasty girls your top priority too!
